import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        position: 'relative',
        width: '100%',
        backgroundColor: '#fff',
        top: 0
    },
    header: {
        flexDirection: 'row',
        marginTop: 40,
        paddingHorizontal: 16,
        justifyContent: 'space-between',
        alignItems: 'center',
    },
    imgFilter: {
        width: 32,
        height: 32
    },
    ctnSearch: {
        flexDirection: 'row',
        alignItems: 'center',
        width: '90%',
        paddingHorizontal: 16,
        paddingVertical: 8,
        backgroundColor: '#dddccc'
    }
});

export default styles;
